import React from "react";
import "./SharedComponent.css";

const SharedComponent = ({ workflowItems }) => {
  return (
    <div className="shared-component">
      <h2>Shared Workflow</h2>
      <div className="shared-workflow-items">
        {workflowItems.map((item, index) => (
          <div key={index} className="shared-item">
            {item}
          </div>
        ))}
      </div>
    </div>
  );
};

export default SharedComponent;
